	return (
		<section id="page-header" className="header">
			<header className="flex flex-row items-center">
				<h1 className="pl-8 text-4xl text-black whitespace-nowrap font-serif">Drew Bowman </h1>

				<nav className="nav-header">
					<a className="header-link" href="#contact-info">Contact Information</a>
					<a className="header-link" href="#education">Education</a>
					<a className="header-link" href="#experience">Experience</a>
					<a className="header-link" href="#projects">Projects</a>
					<a className="header-link" href="#skills">Skills</a>
					<a className="header-link" href="#honors-and-awards">Honors and Awards</a>
				</nav>
			</header>
		</section>
	);

}

